PESHAWAR, Apr 21 (APP): Khyber Pakthunkhwa Governor Shah Farman and Chief Minister Mahmood Khan Wednesday called on Prime Minister Imran Khan here at the Governor House.
They discussed ongoing development projects in Khyber Pakthunkhwa, including the merged tribal districts, and others matters pertaining to the public welfare.
